import React from "react";
import styled from "styled-components";
import Tag from "../components/Tag/Tag";

const Box = (props) => {
  return (
    <Block>
      <h1>Some text</h1>
      <Tag />
      {props.children}
    </Block>
  );
};

export default Box;

const Block = styled.div`
  font-family: "Roboto", sans-serif;
  display: flex;
  flex-direction: column;
  align-items: center;

  overflow: hidden;
  margin: 0;
  background: papayawhip;
`;
